The MQQ cylinder is a compact, low friction cylinder  designed for low pressure, low speed, uniform speed or low friction applications.  MQQ is available as standard or a lateral load resisting type (with built-in ball bushings).  Bore sizes range from 10mm to 28mm and strokes are available up to 100mm.  
